# @section DESCRIPTION
# Tests matrices integrations derived through integrations.
##
import unittest
from . import Matrices
import sympy
from fractions import Fraction as Fra

class TestMatrices( unittest.TestCase ):
  ##
  # Tests derivation of substituted matrices.
  ##
  def test_subs(self):
    l_xi  = sympy.symbols('xi_1')

    l_subs = [ (l_xi, 0), (l_xi, 1), (l_xi, Fra(1,2)) ]

    l_basis = [ 1,
                2*l_xi-1,
                Fra(3,2) * (2*l_xi -1)**2 - Fra(1,2),
                -3*l_xi + Fra(5,2) * (2*l_xi -1)**3 + Fra(3,2) ]

    l_subs = Matrices.subs( l_subs, l_basis )
    l_subsUt = sympy.Matrix( [ [ 1, -1,  1,       -1 ],
                               [ 1,  1,  1,        1 ],
                               [ 1,  0, -Fra(1,2), 0 ]
                             ] )
    self.assertEqual( l_subs, l_subsUt )

  ##
  # Tests derivation of substituted list.
  ##
  def test_subsAll(self):
    l_xi1  = sympy.symbols('xi_1')
    l_xi2  = sympy.symbols('xi_2')
    l_xi3  = sympy.symbols('xi_3')

    l_chi1  = sympy.symbols('chi_1')
    l_chi2  = sympy.symbols('chi_2')

    l_basis = [ 1, l_xi1*l_xi1, l_xi1+l_xi2, l_xi1*l_xi2+l_xi3, l_xi3 ]
    l_basisS = Matrices.subsAll( [ (l_xi1, l_chi2), (l_xi2, 1), (l_xi3, l_chi1) ],
                                 l_basis )

    # check substituted basis
    self.assertEqual( l_basisS,
                      [1, l_chi2*l_chi2, l_chi2+1, l_chi2*1+l_chi1, l_chi1] )

  ##
  # Test integration of function over a list.
  ##
  def test_intL(self):
    l_xi  = sympy.symbols('xi_1')
    l_ints = [ [(l_xi, 0, 1)], [(l_xi, 1, 2)], [(l_xi, 0, 0)] ]
    l_basis = [ 1,
                2*l_xi-1 ]

    l_intL = Matrices.intL( l_ints, l_basis )

    # check integrated basis
    self.assertEqual( l_intL, sympy.Matrix( [ [1, 0], [1, 2,], [0, 0] ] ) )

  ##
  # Tests derivation of mass matrices.
  ##
  def test_mass(self):
    l_xi  = sympy.symbols('xi_1')
    l_int = [(l_xi, 0, 1)]
    l_basis = [ 1,
                2*l_xi-1,
                Fra(3,2) * (2*l_xi -1)**2 - Fra(1,2),
                -3*l_xi + Fra(5,2) * (2*l_xi -1)**3 + Fra(3,2) ]

    # first order
    l_mass = Matrices.mass( l_int, l_basis[0:1] )
    l_massUt = sympy.Matrix( [[1]] )
    self.assertEqual( l_mass, l_massUt )

    # second order
    l_mass = Matrices.mass( l_int, l_basis[0:2] )
    l_massUt = sympy.Matrix( [ [1, 0        ],
                               [0, Fra(1,3) ]
                             ] )
    self.assertEqual( l_mass, l_massUt )

    # third order
    l_mass = Matrices.mass( l_int, l_basis[0:3] )
    l_massUt = sympy.Matrix( [ [1, 0,        0        ],
                               [0, Fra(1,3), 0        ],
                               [0, 0,        Fra(1,5) ]
                             ] )
    self.assertEqual( l_mass, l_massUt )

    # fourth order
    l_mass = Matrices.mass( l_int, l_basis[0:4] )
    l_massUt = sympy.Matrix( [ [1, 0,        0,        0        ],
                               [0, Fra(1,3), 0,        0        ],
                               [0, 0,        Fra(1,5), 0        ],
                               [0, 0,        0,        Fra(1,7) ]
                             ] )
    self.assertEqual( l_mass, l_massUt )

